import * as services from "../services/personelServices";
import { useState, useEffect } from "react";

export default function PersonalPage() {
  const [personalList, setPersonalList] = useState();

  useEffect(() => {
    if (!personalList) {
      services.getPersonel().then((res) => {console.log(res);setPersonalList(res?.data)});
    }
  }, [personalList]);

  return (
    <table>
      <tr>
        <th>Personel Adı</th>
        <th>Personel Soyadı</th>
        <th>Personel TC</th>
      </tr>

      {personalList?.map((item) => (
        <tr>
          <td>{item?.personelName}</td>
          <td>{item?.personelSurname}</td>
          <td>{item?.personelTc}</td>
        </tr>
      ))}
    </table>
  );
}
